import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

function MyPage() {
  return <h2>마이페이지</h2>;
}

function Login() {
  return <h2>로그인</h2>;
}

function SignUp() {
  return <h2>회원가입</h2>;
}

function App() {
  return (
    <Router>
      <div className="flex justify-center mt-10">
        <Link to="/my-page" className="mr-4 px-4 py-2 bg-blue-500 text-white rounded-md">마이페이지</Link>
        <Link to="/login" className="mr-4 px-4 py-2 bg-blue-500 text-white rounded-md">로그인</Link>
        <Link to="/sign-up" className="px-4 py-2 bg-blue-500 text-white rounded-md">회원가입</Link>
      </div>

      <Route path="/my-page" component={MyPage} />
      <Route path="/login" component={Login} />
      <Route path="/sign-up" component={SignUp} />
    </Router>
  );
}

export default App;
